INSERT INTO `announcers` VALUES (1,'Катерина Олександрівна Осадча',2005,NULL,'1983-09-12','магістр Київського національного університету','Частиною образу Каті Осадчої є екстравагантні капелюшки.','жіноча'),(2,'Юрій Миколайович Горбунов',1992,NULL,'1970-08-24','магістр Київського інституту театрального мистецтва','Ідеальним форматом для себе вважає вечірнє ток-гумор-лайт-шоу.','чоловіча'),(3,'Ребрик Лілія Іванівна',2006,NULL,'1981-05-08','магістр Київського національного університету театру, кіно і телебачення',NULL,'жіноча'),(4,'Марія Олександрівна Єфросініна',1998,NULL,'1979-05-25','магістр Київського національного університету','Одна з найзатребуваніших телеведучих України.','жіноча'),(5,'Руслан Вікторович Сенічкін',2006,NULL,'1979-09-27','бакалавр Дніпропетровського Національного університету','Готовий до будь-яких експериментів у прямому ефірі.','чоловіча'),(6,'Вадим Олександрович Абрамов',1999,NULL,'1980-11-12','магістр Національного технічного університету України «Київський політехнічний інститут»','Вільно володіє англійською, французькою та іспанською мовами.','чоловіча'),(7,'Жанна Йосипівна Бадоєва',2011,2015,'1976-03-18',NULL,'Бадоєва була першою жінкою-резидентом у шоу Comedy Club.','жіноча'),(8,'Володимир Олександрович Зеленський',1997,NULL,'1978-01-25','бакалавр Криворізького економічного інституту','Він - уособлення сучасного українського гумору.','чоловіча'),(9,'Ганна Віталіївна Жижа',2004,NULL,'1978-06-09','бакалавр Кіровоградського державного університету','Досконало знає англійську, закінчила 2 курси школи французької мови.','жіноча'),(10,'Андрій Юрійович Доманський',1992,NULL,'1974-08-08','бакалавр Одеського політехнічного університету','Значну популярність здобув як ведучий програм «Нового каналу».','чоловіча'),(11,'Андрій Олександрович Бєдняков',2011,NULL,'1974-08-08',NULL,'З 2014 року працює на російському телебаченні.','чоловіча'),(12,'Дмитро Леонідович Танкович',2000,NULL,'1974-08-08','магістр Білоруського державного економічного університету',NULL,'чоловіча'),(13,'Ірена Карпа',2005,2012,'1980-12-08','магістр Київського національного лінгвістичного університету',NULL,'жіноча'),(14,'Ольга Павлівна Цибульська',2007,NULL,'1985-12-14',NULL,'Презентувала книгу восени 2016 року про те, як встигати все.','жіноча'),(15,'Леся Іванівна Нікітюк',2012,NULL,'1987-10-19','бакалавр Хмельницької гуманітарно-педагогічної академії',NULL,'жіноча'),(16,'Антiн Дмитрович Мухарський',1999,2013,'1968-11-14','магістр Київського театрального інституту',NULL,'чоловіча'),(17,'Сергій Дмитрович Притула',2006,NULL,'1981-06-22',NULL,'Під час зйомок Притула принципово не їсть: вважає, що артист має бути голодним.','чоловіча'),(18,'Ольга Михайлівна Коник-Фреймут',2008,NULL,'1982-02-25','магістр Львівського національного університету','Здобула 7 нагород у різних номінаціях.','жіноча'),(19,'Олександр Сергійович Педан',2006,NULL,'1982-03-24','бакалавр Хмельницького національного університету','Любить екстремальні види спорту.','чоловіча'),(20,'Надія Олександрівна Мейхер',2006,NULL,'1982-04-10','молодший спеціаліст коледжу ім. Ушинського','Також є співачкою.','жіноча'),(21,'Михайло Антонович Петрик',2015,NULL,'2014-05-02',NULL,NULL,'чоловіча'),(22,'Василіса Фролова',1995,NULL,'1978-02-16',NULL,'Українська модель, телеведуча, акторка та ведуча прямого ефіру на радіо.','жіноча'),(23,'Тала Калатай',2003,NULL,'1982-05-29','магістр Київського національного університету театру, кіно і телебачення','Навесні 2016 року приєдналася до патріотичного флешмобу #яЛюблюСвоюКраїну.','жіноча');
