INSERT INTO `programs` VALUES (1,'\"Друзі\"','т/с','комедія ситуацій',45,'США','Марта Кауффман','Популярний американський ситком, про групу з шести друзів, що живуть у Нью-Йорку',1,3),(2,'\"Сніданок з 1+1\"','ранкове шоу',NULL,180,'Україна','Юлія Жмакіна','Максимумом корисної та розважальної інформації, розрахованої на найширшу аудиторію.',1,1),(3,'\"Орел і Решка\"','телепрограма',NULL,45,'Україна','Олена Синельникова','Російськомовна пізнавально-розважальна телепрограма, присвячена подорожам.',1,1),(4,'\"Час новин\"','новини',NULL,30,'Україна','Віталій Гайдукевич','Найкоротший шлях від події до глядача: щодня і щогодини.',1,2),(5,'\"Серця трьох-4\"','телешоу',NULL,100,'Україна','Олексія Удовицького','Цього разу шукати кохання на проекті будуть дуже експресивні героїні.',0,3),(6,'\"Світське життя\"','світські хроніки',NULL,45,'Україна','Олеся та Андрій Ногіни','Програма про багатих і знаменитих людей, а також світські заходи, які вони відвідують.',1,2),(7,'\"Фіксики\"','м/с','Навчальний',60,'Росія','Георгій Васильєв','Анімаційний мультсеріал для всієї родини. ',1,1),(8,'\"Холостяк - 7\"','реаліті-шоу',NULL,100,'Україна','Warner Bros. Television','Під час зустрічей дівчата повинні сподобатися Холостяку, щоб позбутися від конкуренток.',0,4),(9,'\"Зірки під гіпнозом\"','розважальне шоу',NULL,45,'Україна','Володимир Єфімов','Відомі люди роблять те, чого ніколи не зробили б у нормальному стані.',0,2),(10,'\"Хто зверху?\"','телешоу',NULL,90,'Україна','Tien','Українська телепрограма, що виходить на Новому каналі щосуботи.',1,2),(11,'\"Одинадцять друзів Оушена\"','х/ф','триллер',116,'США','Стівен Содерберг','Картина створена на основі однойменного фільму 1960 року.',1,2),(12,'\"Неймовірна правда про зірок\"','телешоу',NULL,45,'Україна','Григорій Решетник','Інформаційна програма про життя зірок вітчизняного і світового шоу-бізнесу.',0,1),(13,'\"На ножах\"','реаліті-шоу ',NULL,75,'Україна','Гордон Рамзі','У межах проекту команда здійснює повний аналіз роботи закладу.',0,1),(1