CREATE DEFINER=`root`@`localhost` PROCEDURE `age_category_announcers`(category varchar(45))
begin
select distinct an_name as 'Ведучий'
from  programs 
join programs_have_announcers on (pr_id=pha_pr_id) 
join announcers on (pha_an_id=an_id)
join audience on (pr_au_id=au_id)
where au_age_category=category;
end ;;
