/*!50003 DROP PROCEDURE IF EXISTS `most_popular` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8 */ ;
/*!50003 SET character_set_results = utf8 */ ;
/*!50003 SET collation_connection  = utf8_general_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `most_popular`()
begin
declare biggest_value int;
DECLARE finished NUMERIC(1); 
DECLARE my_cursor CURSOR for
SELECT 
    COUNT(pha_pr_id) as temp
FROM
    programs_have_announcers
GROUP BY pha_an_id
order by temp desc
limit 1;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET finished = 1;
set finished = 0;
OPEN my_cursor;
    FETCH my_cursor INTO biggest_value; 
    WHILE( finished != 1) DO 
         select an_name as 'Ведучий', COUNT(pha_pr_id) as 'Кількість програм'
         from programs_have_announcers 
         join announcers on (pha_an_id=an_id)
         group by 1 
         having COUNT(pha_pr_id) = biggest_value; 
        FETCH my_cursor INTO biggest_value;
	end while;
    CLOSE my_cursor;
end ;;
DELIMITER ;
