DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `program_time`(program_name varchar(45))
begin
select case weekday(sc_date)
when 0 then 'Понеділок'
when 1 then 'Вівторок'
when 2 then 'Середа'
when 3 then 'Четвер'
when 4 then 'П\'ятниця'
when 6 then 'Субота'
when 7 then 'Неділя'
end as 'День тижня', sc_date as 'Дата', sc_time as 'Час'
from  programs join schedule on (pr_id=sc_pr_id)
where pr_name=program_name;
end ;;
